// To pochodzi z muster create-react-app
import React from "react";
import ReactDOM from "react-dom/client";
import "./styles.css";

import * as App from "./App";
import * as Section from "./Section";


// Render moich wszystkich lekcji
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <React.StrictMode>
      <Section.Header />
      <Section.Chapter />
      <App.Lesson1x1 />
      <SectionFooter />
    </React.StrictMode>
  </>
);
